import React from 'react'

function Todo() {
    return (
        <div className='col-sm-3 mx-3 my-2 alert bg-light'>
            <div className="card-header">
                Header
            </div>
            <hr></hr>
            <div className="card-body mt-12">
                <h4 className='card-title'>Light Card Title</h4>
                <p className='card-text'>Some text example</p>
            </div>
        </div>
    )
}

export default Todo;
